    return(
        <>
        {            
            data.map(tour => {
                console.log(tour.id);
                return(
                    <div onClick={handelClicked} key={tour.id}> 
                        <h3>{tour.name}</h3>
                        <img src={tour.image} alt="" />                                                                      
                    </div>
                )

